import React from "react";
import "./footer.css";

 class Footer extends React.Component {


  render() {
    return (
      <div id="footer">
        <div className="container">
          <input

            className="inputName"
            placeholder="Name..."
            type="text"
          />
          <input

            className="inputNumber"
            onWheel={(e) => e.target.blur()}
            placeholder="Number..."
            type="number"
          />
        </div>
        <div

          id="btn"
        >
          Add new contact
        </div>
      </div>
    );
  }
}
export default Footer
